import React from "react";
import ".././App.css";

class Timer extends React.Component {
  render() {
    return (
      <div>
        <h1>This page</h1>
        <form
          onSubmit={ev => {
            ev.preventDefault();
            this.props.handleSetState("login");
          }}
        >
          <input type="submit" value="Voltar" />
        </form>
      </div>
    );
  }
}

export default Timer;
